  return (

          <Routes>
            <Route path ="/" element={<RestaurantsList />} />
            <Route path ="/restaurants/:id/review" element={<AddReview />} />
            <Route path ="/restaurants/:id" element={<Restaurant />} />
            <Route path="/login" element={<Login />}/>
          </Routes>
  );
}

export default App;

